(364, 0, 'UC310', 946, 710, 'PRODUCT FEATURES:\r\n1. Over 500kbps data transfer rate.\r\n2. Draws its power from the USB Connection - No power adapter required.\r\n3. Work with cellular phone, PDA, Digital Cameras and Modems.\r\n4. No IRQs, No IRQ Conflicts.  \r\n***Compatible with WINDOWS', '<p>FEATURES: 1.	Over 500kps data transfer rate. 2.	Draws its power from the USB Connection- No Power Adapter Required. 3.	Work with cellular phone, PDA, Digital Cameras and Modems. 4.	NO IRQs, NO IRQ Conflicts. 5.	License Software  6.	Compatible with Windows 2000, XP, Vista, Windows 7 or Later , MAC OS (X)</p>', 'resized/UC310_USB_A_M_to_5539dda152f4a_90x90.jpg', 'UC310_USB_A_M_to_5539dda15e283.jpg', 'y', '', 'UC310 USB A M to DB 9 M Adapter', 0.2, '3 MONTHS'),
