(383, 0, 'VS101', 2365, 1774, 'The video splitter takes one video signal input and amplifies/duplicates the same signal on multiple monitors.', '<p>The video splitter takes one video signal input and amplifies/duplicates the same signal on multiple monitors. It supports daisy chain function that enables a user to connect as many monitors as required. It is also provides flexible and cost-effective solutions for video broadcasting and remote monitoring at airlines, restaurants, production and industrial control, security companies, schools and training centers and others.</p>\r\n<p><strong>Key features:</strong></p>\r\n<p>o One video inputs to two, four, eight video outputs</p>\r\n<p>o Supports VGA, SVGA, XGA and multi sync monitors</p>\r\n<p>o Long distance transmission: up to 165 feet (50m)</p>\r\n<p>o Supports 150/250/350MHz video bandwidth (model related)</p>\r\n<p>o Supports resolution 1,600 x 1,200/1,920 x 1,440/2,300 x 1,920 (model related)</p>\r\n<p>o DDC and DDC2 support at port 1</p>\r\n<p>o Ideal for video broadcasting: remote monitoring, security monitoring, production and industrial control monitoring, educational facilities</p>\r\n<p>o Daisy-chainable</p>\r\n<p>o Compact design with all metal casing</p>\r\n<p><strong> </strong></p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>> Video input connectors: 1 x HDB-15 male</p>\r\n<p>> Video output connectors: 4 x HDB-15 female</p>\r\n<p>> Cable distance (device to monitor): 165 feet/50m (maximum)</p>\r\n<p>> Signal type: VGA, SVGA, XGA, multi sync MSV235: MSV225: 1,920 x 1,440  MSV215: 1,600 x 1,200 </p>\r\n<p> </p>\r\n<p>Maximum resolution: 2,300 x 1,920 MSV235: 350MHz MSV225: 250MHz  MSV215: 150MHz Bandwidth:</p>\r\n<p>Housing: metal</p>\r\n<p>DC power adapter: 9V Dimensions: 13 x 7.5 x 4.2cm</p>\r\n<p>Weight: 0.42kg</p>', 'resized/VGA__Splitter_4__53ba60b052d98_90x90.jpg', 'VGA__Splitter_4__53ba60b0e5fd1.jpg', 'y', '', 'VGA  Splitter 4 ports	250 MHZ', 0.2, '3 MONTHS'),
