(465, 0, 'NPS009', 699, 524, '" CRAZY SALE!!! 50% OFF for ALL Sizes of EXAGERATE LAPTOP SLEEVE!"\r\n\r\nAvialable Size: 7-9" , 10", 12, 13, 14, 15 & 16" \r\n\r\n<p />Anti-shock Polyurethane Sponge Notebook Bag has been specially designed to absorb shock energy. It releases the external shock', '<p>High density POLYURETHANE, “Memory Sponge”, protects your notebook from scratches, shock and water spillages. -</p>\r\n<p>Corners and side protections -</p>\r\n<p>Transparent upper elastic bands holds your notebook without blocking the LCD Screen -</p>\r\n<p>Designed to access your notebook without having to be removed. -</p>\r\n<p>Designed to be carried into another bag.</p>\r\n<p> </p>\r\n<p>Brand: Exagerate</p>\r\n<p>Colors: Red, Black, Pink, Blue & Grey</p>\r\n<p> </p>', '6b55270502f088d44cefc452dc5920c1.jpg', 'd72dfa6e9920267eb92d3339bbdc614f.jpg', 'y', '', 'NPS009 Mini Notebook Sleeve 7-8- 9"', 0.2, '7 DAYS'),
