(473, 0, 'UD110', 860, 645, 'Upgrade to a new computer is not easier. The Easy Transfer Cable offers a quick way to transfer your files and settings from your old computer to a new one. Just install the software provided on the enclosed CD onto your XP computer', '', 'resized/UD110_Easy_Trans_514a7b0515b43_90x90.jpg', 'UD110_Easy_Trans_514a7b0572bc4.jpg', 'y', '', 'UD110 Easy Transfer Cable', 0.2, '3 MONTHS'),
(477, 0, 'UTEC10', 1183, 887, 'USB extension cord make your USB based ExpressCard such as (3.5G HSDPA, Broadband Wireless, memory, RS232, 3G modems and WiMax) works universally with all your Desktop, Laptop and Notebook through USB port.', '<p>USB extension cord make your USB based ExpressCard such as (3.5G HSDPA, Broadband Wireless, memory, RS232, 3G modems and WiMax) works universally with all your Desktop, Laptop and Notebook through USB port. It supports USB-Based ExpressCard Host Adapters including 3.5G HSDPA, Broadband Wireless, memory, 3G modems, WiMax, RS232 and Solid State Disk</p>\r\n<p><strong>Features:</strong></p>\r\n<p> Compliant with USB 2.0 Standard</p>\r\n<p> Allows USB Base ExpressCard/34 or ExpressCard/54 module working via USB Port</p>\r\n<p> Compatible with all USB 2.0-MODE ExpressCards including many WLAN, WiMax, 3G (HSDPA and CDMA) and memory, e.g. storage media ExpressCards.</p>\r\n<p> Compact design with low power consumption</p>\r\n<p> Compatible with MAC and PC laptops  RoHs compliance, easy installation</p>\r\n<p> Support Windows 2000, ME, XP, Vista and Mac 8.6 and above</p>\r\n<p> </p>\r\n<p>NOTE: NOT COMPATIBLE WITH ANY PCI-e based ExpressCards</p>\r\n<p> </p>\r\n<p> </p>', '62e692a83f6a86d842beaf8e10e72352.jpg', '9581b20a839ca755d83ce2bb59d1bc3c.jpg', 'y', '', 'UTEC10  USB 2.0 to 34/54mm USB based Express Card Adaptor', 0.2, '3 MONTHS'),
