(494, 0, 'DLT10', 0, 0, 'The audio video extender uses a local transmitter (DLT10), and a remote receiver (the DLR10) to extend the transmission distance up to 150M via CAT 5/5e/6 UTP/STP cable.', '<p>The audio video extender uses a local transmitter (DLT10), and a remote receiver (the DLR10) to extend the transmission distance up to 150M via CAT 5/5e/6 UTP/STP cable. DLT10 can be daisy chained with another DLT50 and DLT10 to upgrade its application.</p>\r\n<p><strong>Key features:</strong></p>\r\n<p>>Compact desktop size transmitter and receiver Works with Cat 5, Czt 5E, Czt 6 Ethernet cable Transmission distance of up to 500ft (150 meters maximum)</p>\r\n<p>>Easily installs and makes adjustment for video signal set-up</p>\r\n<p>>Compatible with DOS, MS Windows, Linux, Unix, and Netware</p>\r\n<p>>No software installation required Supports high VGA resolution up to 1,024 x 768</p>\r\n<p>>Power LED and data transmission LED indication</p>\r\n<p>>Simple and easy to use with PS/2 mouse and PS/2 keyboard</p>\r\n<p>>Connects between transmitter and receiver with a standard network cable</p>\r\n<p> </p>', '5fb10dd44769ff4a4f4cb0feb7780628.jpg', 'c87df92b062fb1de3f96f1f2efdd70c8.jpg', 'n', '', 'DLT10 Video Transmitter and Receiver', 0.2, '');
