(730, 0, 'VRP01', 8387, 6290, 'This VGA UTP Extender 1X1 Splitter with Audio is an ideal device for local displaying and remote viewing. It combines split function and extension function. It distributes the input of the VGA signal and audio signal into the local and remote outputs simu', '<p> </p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: medium;"> </span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: medium;">VGA UTP Extender with Audio--VRP01</span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<div style="padding: 5pt 0in; margin-right: 0in; margin-left: -13pt; mso-element: para-border-div; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt; border: 1pt medium dotted none #cccccc currentColor;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<p style="margin: 0in 0in 0pt 0.25in; padding: 0in; border: currentColor; border-image: none; line-height: 17pt; text-indent: -0.25in; display: none; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in; mso-padding-alt: 5.0pt 0in 5.0pt 0in;"><span style="display: none; mso-bidi-font-size: 6.0pt; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; mso-hide: all;"><span style="mso-list: Ignore;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="5" src="file:///D:/H21%20files/Product%20Details/PicExportError" border="0" height="5" alt="*" /></span></span></span><span style="color: #333333; font-family: ">Price:Price Available</span></p>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></div>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="font-family: "><span style="color: #000000;">P/N:  VRP01</span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="font-family: "><span style="color: #000000;">Description</span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #333333; font-family: ">This VGA UTP Extender 1X1 Splitter with Audio is an ideal device for local displaying and remote viewing. It combines split function and extension function. It distributes the input of the VGA signal and audio signal into the local and remote outputs simultaneously. Receiver by Cat5 x1 works with the Sender as a full functional module by receiving the distributed signal from the sender and transmitting to display. Only by the most inexpensive UTP cable with cross stand inside, the full functional module extend the VGA display max up to 300 meters.</span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #333333; font-family: ">It offers solutions for VGA retail and show site and Projector factory, noise, space and security concerns, data center control, information distribution, conference room presentation, school and corporate training environments. </span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="font-family: "><span style="color: #000000;">Specifications</span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #333333; font-family: ">This device has many features that enable it to perform in a superior manner. Among those features you will find:</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: ">1</span><span style="color: #333333; font-family: ">、</span><span style="color: #333333; font-family: ">Extend VGA video and stereo audio signal max up to 300m over one UTP cable with cross stand inside</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: ">2</span><span style="color: #333333; font-family: ">、</span><span style="color: #333333; font-family: ">Adjusting GAIN and PEAK to adapt for the different length of UTP cable.</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: "> GAIN: Brightness adjustment.</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: "> PEAK: Skew adjustment.</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: ">3</span><span style="color: #333333; font-family: ">、</span><span style="color: #333333; font-family: ">Supports resolution max up to 1920x1200.</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: ">4</span><span style="color: #333333; font-family: ">、</span><span style="color: #333333; font-family: ">Dual output at local unit: 1 x VGA output for local site, plus 1 x UTP output for remote site.</span><span style="color: #333333; font-family: "><br /><span style="font-size: small;"> </span></span><span style="color: #333333; font-family: ">5</span><span style="color: #333333; font-family: ">、</span><span style="color: #333333; font-family: ">Work with monitors projectors, HDTV, and flat panels.</span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="font-family: "><span style="color: #000000;">Connection</span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="601" src="data:image/png;base64," border="0" height="300" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="200" src="data:image/png;base64," border="0" height="140" /><img width="188" src="data:image/png;base64," border="0" height="132" /><img width="176" src="data:image/png;base64," border="0" height="123" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="font-family: "><br /><span style="color: #000000;"> </span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 0pt;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>', 'resized/VRP01_VGA_Extend_53c49d5aa8f03_90x90.jpg', 'VRP01_VGA_Extend_53c49d5ad4a77.jpg', 'y', '', 'VRP01 VGA Extender w/ audio (Transmitter/Receiver Single Port)', 0.2, '3 MONTHS'),
