(827, 0, 'DTV-101', 1828, 1371, 'USB HDTV tuner allows users to capture free HDTV broadcast and Radio Stations using an indoor HDTV antenna. \r\nThe antenna is connected to the HDTV USB Device, which then connects to a USB slot on your computer. Once HDTV broadcasts are captured you can wa', 'USB 2.0 Digital TV Receiver \r\nHDTV Tuner Dongle Stick Antenna with Remote\r\n\r\nUSB HDTV tuner allows users to capture free HDTV broadcast and Radio Stations using an indoor HDTV antenna. \r\nThe antenna is connected to the HDTV USB Device, which then connects to a USB slot on your computer. Once HDTV broadcasts are captured you can watch and record the channels and listen to the radio stations that your antenna can pick up.\r\n\r\n \r\nFeatures:\r\n•	Watch digital TV Live on Laptop or Desktop \r\n•	Listen Radio Stations\r\n•	Still image snapshots\r\n•	Time-shifting\r\n•	Digital TV recording and playback\r\n•	Support EPG\r\n•	Support Teletext\r\n•	Support Microsoft DBA Drivers\r\n•	Remote Control\r\n•	Support Win OS\r\n\r\nSpecifications:\r\nUSB 2.0 Standard Interface\r\nFrequency: TV/473, 143-803, 143Mhz\r\nPunctured Codes: ½, 2/3, ¾, 4/5, 5/6 & 7/8\r\nBandwidth: 6 Mhz- Multiplexing\r\nStream Capture: PES & TS\r\n\r\nPackage Content:\r\n1 x Digital TV Stick\r\n1 x Antenna\r\n1 x Remote Control Unit\r\n1 x Installation CD', 'resized/USB_Digital_TV_f_556c18e7124c6_90x90.jpg', 'USB_Digital_TV_f_556c18e71c7d3.jpg', 'y', '', 'USB Digital TV for Computers', 0.2, '1 MONTH'),
(509, 0, 'VB100', 0, 0, 'The USB Video Snake Scope  allows you to record the video footage while having it traveling through those hard-to-reach corners.', 'The Snake Scope Video Inspection Borescope comes with a 300k water-resistant camera complete with two adjustable white LEDs. It is easily operated by plugging the USB connector directly into your computers USB port. The Snake Scope is able to capture high quality colour images and video by the touch of a button on the handle and requires no batteries because it draws its power directly from the USB port on your computer.', 'resized/VB100_USB_Video__51a05cbb8e476_90x90.jpg', 'VB100_USB_Video__51a05cbcc3fad.jpg', 'n', '', 'VB100 USB Video Snake Scope', 0.2, ''),
(510, 0, 'VB110', 0, 0, 'Helping you to search inside hard to see places the Video Borescope is a very handy pipeline inspection tool.', '<p>This video borescope inspection system features a 2.4-inch LCD color monitor for real-time viewing, with a 10mm flexible camera probe that retains its configured shape for inspecting hard-to-reach areas. A standard 1-meter probe length is provided with the unit.</p>\r\n<p>• Home inspection: Inspect in walls for mold, insect infestation, electrical wire or water pipe location</p>\r\n<p>• Pest Control: Inspect for termites in wall cavities</p>\r\n<p>• HVAC: Inspect inside ducts, behind motors and compressors</p>\r\n<p>• Automotive: View inside or around engines and transmissions</p>\r\n<p>• Government: Safety and security inspections</p>\r\n<p>• Industrial: Inspect weld integrity, process equipment, gears, molding machines</p>\r\n<p>• Aerospace: Aircraft inspections for contamination, debris, cracks or other damage</p>\r\n<p> </p>\r\n<p><strong>Magnet and Hook Tips</strong></p>\r\n<p>Included Strong Magnetic Tip allows you to pick-up nuts, bolts and screws you may have dropped in inaccessible places. Easy clip on design for fast installation. Hook Tip: J-shaped extension used to tug, pull or pick up small objects or wires.</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>• Sensor:1/18 inch analog CMOS</p>\r\n<p>• Array Size:320 x 240 (NTSC)</p>\r\n<p>• View Angle:54°</p>\r\n<p>• LED:2 pcs (light adjustable)</p>\r\n<p>• Focal Distance:3-6cm</p>\r\n<p>• LCD:2.4 inch TFT 234x320 pixel</p>\r\n<p>• Video out Format :NTSC</p>\r\n<p>• Level of Waterproof: IP68</p>\r\n<p>• Outer Diameter of Camera:10mm</p>\r\n<p>• Outer Diameter of Tube:6.8mm</p>\r\n<p> • Length of Metal tube:1m)</p>\r\n<p>• Continuous Working time:10h(Max)</p>\r\n<p>• Battery:4 X AAA</p>\r\n<p>• Body Size(LxWxH):81x75x62mm(Max)</p>\r\n<p> </p>\r\n<p><strong>Features:</strong></p>\r\n<p>• 2 adjustable white LED lighting .</p>\r\n<p>• Lens: F2.8 view of angele 54.</p>\r\n<p>• 1/18 inch analog CMOS.</p>\r\n<p>• Focal distance:3-6cm .</p>\r\n<p>• Lens outer diameter 10mm .</p>\r\n<p>• NTSC TV Video output .</p>\r\n<p>• Picture vertical mirror/normal function .</p>\r\n<p>• Metal tube in 1meter length(1m~20m option) .</p>\r\n<p>• Tube outer diameter 6.8mm.</p>\r\n<p>• 2.4 inch Color LCD:234*320 pixels.</p>\r\n<p>• Powered by 4 X AAA batteries.</p>\r\n<p>• PE covered tube, ABS Handler.</p>\r\n<p>• Magnetic & Hook accessories. Package Includes:</p>\r\n<p>• 1x Video Borescope • 1x Tool Box • 1x Video cable • 1x Hook and Magnetic Tip</p>\r\n<p> </p>\r\n<p> </p>', 'resized/VB110_Video_Bore_51a05d04b1861_90x90.jpg', 'VB110_Video_Bore_51a05d0515502.jpg', 'n', '', 'VB110 Video Borescope with LCD Screen', 0.2, ''),
