(566, 0, 'AP210', 1075, 806, 'The Mini Display Port to DVI Adapter lets you connect an advanced digital monitor, such as the 20- or 23-inch Cinema Display, to a MacBook, MacBook Pro, or MacBook Air with a Mini DisplayProt.', '<p>The Mini Display Port to DVI Adapter lets you connect an advanced digital monitor, such as the 20- or 23-inch Cinema Display, to a MacBook, MacBook Pro, or MacBook Air with a Mini DisplayProt.</p>\r\n<p>The new MacBook, MacBook Pro, and MacBook Air each have a Mini Display Port that allows you to connect an external display or projector using an adapter. You can use an external display as your main workspace or to extend your desktop, or you can work in mirrored mode with a projector so you can view what your audience see. Use the Mini Display port to DVI Adapter to connect an advanced digital monitor, such as the 20- or 23-inch Cinema Display, that includes a DVI connector.</p>\r\n<p>Review the documentation or check with the manufacturer of your monitor to make sure you\'re choosing the right adapter.</p>\r\n<p>Compatible only with MacBook, MacBook Pro, and MacBook Air with Mini DisplayPort.</p>', 'resized/AP210_Mini_Displ_53ba68a8cfb96_90x90.jpg', 'AP210_Mini_Displ_53ba68a927007.jpg', 'y', '', 'AP210 Mini Display Port to DVI Female Adapter', 0.2, '3 MONTHS'),
(568, 0, 'CB962C-06', 505, 379, 'SuperSpeed USB will deliver 10x the data transfer rate of Hi-Speed USB, as well improved power efficiency.This USB is backward compatible with USB 2.0 Devices interoperate with USB 2.0 platforms. Host support USB 2.0 legacy devices.', '<p>Feature:</p>\r\n<p>1. USB 3.0 cable provided 10 times data transfer speed than USB 2.0;</p>\r\n<p>2. Data transfer rate up to 4.8 Gbps.</p>\r\n<p>3. Compatible with USB 2.0.</p>\r\n<p>4. Efficient in power supply then USB2.0. USB 3.0 cable power ability is 900mA compared with former USB 100mA</p>\r\n<p> </p>\r\n<p>Specification: .</p>\r\n<p>> USB 3.0 connector 30u" UL94V-0 .</p>\r\n<p>> USB 3.0 Cable UL2725 28/28/28 AWG OD: 5.5mm .</p>\r\n<p>> Blue Color</p>\r\n<p> </p>\r\n<p> </p>', '4ca21fed3c33a828ec9217e2bcccc129.jpg', '004ac5d95cbbfc6682d978a1d11d16f7.jpg', 'y', '', 'CB962C-06 USB 3.0 A: A M/F Extension Cable 6ft.', 0.2, '6 MONTHS'),
(569, 0, 'CB932C-06', 484, 363, 'SuperSpeed USB brings significant performance enhancements to the ubiquitous USB Standard, while remaining compatible with the billions of USB-enabled devices currently deployed in the market.', '<p>Feature:</p>\r\n<p>1. USB 3.0 cable provided 10 times data transfer speed than USB 2.0;</p>\r\n<p>2. Data transfer rate up to 4.8 Gbps.</p>\r\n<p>3. Compatible with USB 2.0.</p>\r\n<p>4. Efficient in power supply then USB2.0. USB 3.0 cable power ability is 900mA compared with former USB 100mA</p>\r\n<p> </p>\r\n<p>Specification: .</p>\r\n<p>USB 3.0 connector 30u" UL94V-0 .</p>\r\n<p>USB 3.0 Cable UL2725 28/28/28 AWG OD: 5.5mm .</p>\r\n<p>Blue Color</p>', '48853da1ad691a920848806c2b5f392a.jpg', 'd09e83a2cfcea57e812ea4d1c932ae76.jpg', 'y', '', 'CB932C-06 USB 3.0 A: B M/M Cable 6ft.', 0.2, '6 MONTHS'),
