(700, 0, 'UST-MHL01', 1075, 806, 'The MHL (Mobile High-Definition Link) Adapter is an accessory made with one purpose in mind to connect your MHL Host like MHL Phone or Tablet to your HDTV for viewing content on a larger screen. This state-of-the –art technology connects your MHL Host to', '<p>With MHL to HDMI Adapter, your MHL phone can be connected to high-definition TV. But if your MHL Phone is Samsung Smartphones, you need an adapter MHL 11pin to Micro 5pin Adapter. Because the terminal product of MHL to HDMI Adapter is Micro USB 5Pin, while the Samsung mobile phone female is Samsung 11Pin.</p>\r\n<p>1.	Uses a single, thin adapter to connect the mobile device to the HDTV.</p>\r\n<p>2.	Connect Micro USB female port to computer or power adapter for charging and getting power using a Micro USB to USB M/M cable.</p>\r\n<p>3.	Built-in MHL Receiver converts a single differential pair to HDMI four differential pairs.</p>\r\n<p>4.	Supports Max resolution to 1280x720p and all bandwidth between 25-75MHz.</p>', 'resized/MHL_USB_Micro__M_53ba670523795_90x90.jpg', 'MHL_USB_Micro__M_53ba670533174.jpg', 'y', '', 'MHL USB Micro (M) 5P to HDMI (F) Adapter  w/ 5to11 converter', 0.2, '3 MONTHS'),
