(704, 0, 'WS-UG17D1', 4731, 3548, 'The USB 2.0 Multi-Display Adapter allows you to connect an extra monitor (CRT, LCD, Projector...) to your desktop PC or laptop’s USB port. The connected monitor can be configured to either clone your primary screen, or extend the Windows desktop allowing', '<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 10pt;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-PH" style="line-height: 115%; font-size: 18pt; mso-fareast-font-family: "><span style="color: #000000; font-family: Calibri;">WS-UG17D1 USB 2.0 Multi-Display Adapter (DVI, HDMI, VGA)</span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 10pt;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="416" src="data:image/png;base64," border="0" hspace="12" height="253" align="left" /></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; line-height: normal; mso-add-space: auto;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;">Product Description:</span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;">The USB 2.0 Multi-Display Adapter allows you to connect an extra monitor (CRT, LCD, Projector...) to your desktop PC or laptop’s USB port. The connected monitor can be configured to either clone your primary screen, or extend the Windows desktop allowing visibility of more applications at the same time.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;">The USB 2.0 Multi-Display Adapter driver used to control the extra screen uses very little computer resources and offers a vast array of screen resolutions and color depths. This ensures that there is little difference in performance between a directly connected screen and a screen connected through the USB 2.0 Multi-Display Adapter.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;">Features:</span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<ul type="disc" style="margin-top: 0in;">\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Easily connect additional monitors using      a USB 2.0 cable</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Simple to install and use</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Quickly add up to six display to a      desktop or a notebook PC with minimal configuration and without an      additional graphics card</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Mirror or Extend a computer display      workspace</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Allows for effortless multitasking</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Bus Powered – No external power supply      needed</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: normal; mso-add-space: auto; mso-list: l1 level1 lfo1;"><span lang="EN-PH" style="mso-fareast-font-family: ">Supports usage through powered KVMP’s      or USB hubs</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span> \r\n</ul>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;">Minimal System Requirements:</span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<ul type="disc" style="margin-top: 0in;">\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">CPU with 1.2GHz or higher processor      (Intel Pentium/Celeron family, AMD K6/Athlon/Duron family, or compatible      processor)</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">256 MB RAM</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">One available USB 2.0 port</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">30Mb of available disk space</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">Super VGA ()800 x 600 or higher      resolution monitor</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<li style="margin: auto auto 0pt; text-align: justify; line-height: normal; font-style: normal; font-weight: bold; mso-add-space: auto; mso-list: l0 level1 lfo2;"><span lang="EN-PH" style="mso-fareast-font-family: ">Win2K / XP / Vista 32 / 64-bit,      Windows 7 or Later , Intel-based Mac OS 10.4.11 or later Linux OS</span></li>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span> \r\n</ul>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 1em 0px 0pt; text-align: justify; line-height: normal; mso-add-space: auto;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-PH" style="mso-fareast-font-family: "><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>', 'resized/USB_2.0_Multi_Di_56a9d35dca465_90x90.jpg', 'USB_2.0_Multi_Di_56a9d35dda681.jpg', 'y', '', 'USB 2.0 Multi-Display Adapter (DVI, HDMI, VGA)', 0.2, '3 MONTHS');
