(705, 0, 'EP-8523', 2365, 1774, 'The EP-8523 150Mbps high-power outdoor wireless 802.11N USB adapter is characterized by high gain and long transmission distance. In case of no obstacles, it offers better transmission effect than other common products. The built-in 16dB directional anten', '<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 0pt; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 20pt; mso-fareast-font-family: " lang="EN-PH"><span style="color: #000000; font-family: Calibri;">EP-8523 Long Range USB Wifi Antenna</span></span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="background: white; margin: 0in 0in 0pt; line-height: 15pt;"><strong><span style="color: #333333; font-family: " lang="EN-PH"> </span></strong></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="background: white; margin: 0in 0in 0pt; line-height: 15pt;"><strong><span style="color: #333333; font-family: " lang="EN-PH">Features: </span></strong><span style="color: #333333; font-family: " lang="EN-PH"><br /> 1. Transmission rate up to 150Mbps.<br /> 2. Comply with IEEE 802.11b, 802.11, and 802.11n standards.<br /> 3. Support USB2.0.<br /> 4. A built-in 16dB directional antenna.<br /> 5. A five-meter-long USB extension cord is provided.<br /> 6. Rainproof and lightning proof.</span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="background: white; margin: 0in 0in 0pt; line-height: 15pt;"><span style="color: #333333; font-family: " lang="EN-PH"> </span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="background: white; margin: 0in 0in 0pt; line-height: 15pt;"><strong><span style="color: #333333; font-family: " 