(809, 0, 'CEHSP0102', 0, 0, 'This is a small, beautiful, practical HDMI Splitter. It distributes the input of the HDMI signal into the four identical outputs simultaneously. It supports full 3D format and 4Kx2K. Its video amplifier bandwidth can be up to 3.4 Gpbs/340MHz. The HDMI Spl', '<p>CODE: CESP0102 DESCRIPTION:  HDMI 1x2 Splitter with Full 3D and 4Kx2K (340MHz)  Introduction This is a small, beautiful, practical HDMI Splitter. It distributes the input of the HDMI signal into the four identical outputs simultaneously. It supports full 3D format and 4Kx2K. Its video amplifier bandwidth can be up to 3.4 Gpbs/340MHz. The HDMI Splitter offers solutions for HDTV retail and show site, HDTV, STB, DVD and Projector factory, noise space and security concerns, data center control, information distribution, conference room presentation, school and corporate training environments. Features This HDMI Splitter has many features that enable it to perform in a superior manner. Among those features you will find; •	Easy to Use: Install in seconds, no need of setting. •	One HDMI input, two HDMI outputs. •	Supports Full 3D and 4Kx2K resolution. •	Supports 340MHZ/3.4Gbps per channel (10.2Gbps all channel) bandwidth. •	Supports 12bit per channel (36bit all channel) deep color. •	Supports HDCP 1.3. •	Supports uncompressed audio such as LPCM. •	Supports compressed audio such as TS Digital, Dolby Digital (including DTS-HD and Dolby True HD).  Specifications  Signal Inputs/Output	 Input DDC Signal	5 volts p-p (TTL) Maximum Single Link Range	4Kx2K Output Video	HDMI (with full 3D and 4Kx2K) Operating Frequency	 Vertical Frequency Range	50 / 60HZ Video Amplifier Bandwidth	3.4Gbps / 340MHz Resolutions(HDTV)	 Interlaced(50&60Hz)	480i, 576i, 1080i Progressive(50&60Hz)	480p, 576p, 720p, 1080p, 4Kx2K Mechanical	 Size(L-W-H)	157 x 70 x 23mm Weight(Net)	265g Warranty	 Limited Warranty	1 Year Service Environmental	 Operating Temperature	0°C to +70°C Operating Humidity	10% to 85% RH (no condensation) Storage Temperature	-10°C to +80°C Storage Humidity	5% to 90% RH (no condensation) Power Requirement	 External Power Supply	5V DC @ 3A Power consumption (Max)	12W Regulatory Approvals	 Converter Unit	FCC, CE, UL Power Supply	UL, CE, FCC Accessories Adapter	 AC Power Adapter	US Standard, UK standard and so on User Manual	  Note: Specifications are subject to change without prior notice.  Package Contents Before attempting to use this unit, please check the packaging and make sure the following items are contained in the shipping caption: 1.	Main Unit 2.	5V DC Power Supply 3.	User’s Manual  Connection and Operation 1.	Connect the HDMI input source and output device into the HDMI Splitter. (HDMI cables are optional). 2.	Insert the DC side of 5V power supply into it and then connect the AC side of the power supply into the wall outlet. 3.	Turn on the power.</p>', 'resized/HDMI_Splitter_2__5549af2d0ddc5_90x90.jpg', 'HDMI_Splitter_2__5549af2d13998.jpg', 'n', '', 'HDMI Splitter 2-Ports w/ Full 3D 340Mhz', 0.2, ''),
