(731, 0, 'VSP0104-S', 25805, 19354, 'This VGA UTP Extender 1X4 Splitter with Audio is an ideal device for local displaying and remote viewing. It combines split function and extension function. It distributes the input of the VGA signal and audio signal into the four identical outputs simult', '<p> </p>\r\n<p> </p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: windowtext; font-family: "><span style="font-size: medium;">VGA UTP Extender 1X4 Splitter/ Receiver  with Audio</span></span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<div style="padding: 5pt 0in; margin-right: 0in; margin-left: -13pt; mso-element: para-border-div; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt; border: 1pt medium dotted none #cccccc currentColor;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span>\r\n<p style="margin: 0in 0in 0pt 0.25in; padding: 0in; border: currentColor; border-image: none; line-height: 17pt; text-indent: -0.25in; display: none; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in; mso-padding-alt: 5.0pt 0in 5.0pt 0in;"><span style="display: none; mso-bidi-font-size: 6.0pt; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; mso-hide: all;"><span style="mso-list: Ignore;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="5" src="file:///D:/H21%20files/Product%20Details/PicExportError" border="0" alt="*" height="5" /></span></span></span><span style="font-family: "><span style="color: #000000;">Price:Price Available</span></span></p>\r\n<span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></div>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">P/N:  VSP0104-S</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Description</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">This VGA UTP Extender 1X4 Splitter with Audio is an ideal device for local displaying and remote viewing. It combines split function and extension function. It distributes the input of the VGA signal and audio signal into the four identical outputs simultaneously. Each receiver by Cat5 x1 works with the Sender as a full functional module by receiving the distributed signal from the sender and transmitting to displays individually. Only by the most inexpensive UTP cable with cross stand inside, the full functional module extend the VGA display max up to 300 meters.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">It offers solutions for VGA retail and show site and Projector factory, noise space and security concerns, data center control, information distribution, conference room presentation, school and corporate training environments. </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Specifications</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">This device has many features that enable it to perform in a superior manner. Among those features you will find:<br /></span><span style="color: #000000;"> 1</span></span><span style="font-family: "><span style="color: #000000;">.</span></span><span style="font-family: "><span style="color: #000000;">Extends VGA video and stereo audio signal max up to 300m over one UTP cable with cross stand inside.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">2. Adjusting GAIN and PEAK to adapt for the different length of UTP cable.<br /></span><span style="color: #000000;"> GAIN: Brightness adjustment.<br /></span><span style="color: #000000;"> PEAK: Skew adjustment.<br /></span><span style="color: #000000;"> 3</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Supports resolution max up to 1920x1200.<br /></span><span style="color: #000000;"> 4. Dual output at local unit: 1 x VGA output for local site, plus 4 x UTP output for remote site.<br /></span><span style="color: #000000;"> 5</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Works with monitors, projectors, HDTV, and flat panels.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Connection</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="654" src="data:image/png;base64," border="0" height="293" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: "> </span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: "> </span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="397" src="data:image/png;base64," border="0" height="231" /><img width="432" src="data:image/png;base64," border="0" height="252" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 0pt;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>', 'resized/VSP0104_S_VGA_Ex_53c39b404275d_90x90.jpg', 'VSP0104_S_VGA_Ex_53c39b407b5d9.jpg', 'y', '', 'VSP0104-S VGA Extender w/ audio (1 Sender/4 Receiver)', 0.2, '3 MONTHS');
