(734, 0, 'E-30', 3763, 2822, 'This kind of HDMI Extender by CAT-5e/6 uses two pieces of CAT-5e/6 cables to extend the HDTV display up to 30 meters for 1080p.  It not only breaks the limitation of the HDMI cable transmission length but also CAT-5e/6 has more flexibility and convenience', '<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: windowtext; font-family: "><span style="font-size: medium;"> </span></span><span style="color: windowtext; font-family: "><span style="font-size: medium;">HDMI Extender 30m By CAT-5e/6--E30D</span></span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h2 style="margin: 0in 0in 0pt;"><span style="font-family: ">Product Name:HDMI Extender 30m By CAT-5e/6--E30D</span></h2>\r\n<h2></h2>\r\n<h2 style="border-width: 1pt medium; border-style: dotted none; border-color: #cccccc currentColor; padding: 5pt 0in; margin-right: 0in; margin-left: -13pt; mso-element: para-border-div; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt;"></h2>\r\n<h2 style="margin: 0in 0in 0pt 0.25in; padding: 0in; border: currentColor; border-image: none; line-height: 17pt; text-indent: -0.25in; display: none; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-list: l0 level1 lfo1; tab-stops: list .5in; mso-padding-alt: 5.0pt 0in 5.0pt 0in;"><span style="display: none; mso-bidi-font-size: 6.0pt; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; mso-hide: all;"><span style="mso-list: Ignore;"><img width="5" src="file:///D:/H21%20files/Product%20Details/PicExportError" border="0" alt="*" height="5" /></span></span><span style="font-family: ">Price:Price Available</span></h2>\r\n<h2 style="border-width: 1pt medium; border-style: dotted none; border-color: #cccccc currentColor; padding: 5pt 0in; margin-right: 0in; margin-left: -13pt; mso-element: para-border-div; mso-border-top-alt: dotted #CCCCCC .5pt; mso-border-bottom-alt: dotted #CCCCCC .5pt;"></h2>\r\n<h2></h2>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">P/N: E30D</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Description</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">This kind of HDMI Extender by CAT-5e/6 uses two pieces of CAT-5e/6 cables to extend the HDTV display up to 30 meters for 1080p.  It not only breaks the limitation of the HDMI cable transmission length</span></span><span style="font-family: "><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">but also CAT-5e/6 has more flexibility and convenience in cable construction.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">Both the sender and receiver are equipped with fixed HDMI cable that allows consumers reduce cost and time for setting. It is capable of supporting DVI (digital visual interface) equipment when used with an HDMI to DVI Adapter, providing greater flexibility and options when integrating several home theater components.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">This product offers solutions for residential consumers: HDTV retail and show site, HDTV, STUB, DVD and Projector factories, noise, space and security concerns, data center control, information distribution, conference room presentation, school and corporate training environments. </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Specifications</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<p style="margin: 1em 0in;"><span style="font-family: "><span style="color: #000000;">This HDMI Extender has many features that enable it to perform in a superior manner. Among those features you will find:</span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">1</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">One pair as a full functional module, no need of setting. </span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">2</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">CAT-5e/6 cable can substitute HDMI cable to achieve long distance transmission. </span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">3</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">Follow the standard of IEEE-568B. </span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">4</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">Transmission distance can be up to 30 meters for 1080p using CAT-6 Cable.</span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">5</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">Compact size.</span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">6</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">Signaling rates up to1.65Gbps in support of 1080P display.</span></span><span style="font-family: "><br /><span style="color: #000000;"> </span></span><span style="font-family: "><span style="color: #000000;">7</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">HDCP compliant.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Connection</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="379" src="data:image/png;base64," border="0" height="189" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="318" src="data:image/png;base64," border="0" height="207" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> <br /></span></p>', 'resized/E_30_HDMI_Extend_53c4a92357144_90x90.jpg', 'E_30_HDMI_Extend_53c4a9235b0ed.jpg', 'y', '', 'E-30	HDMI Extender (Transmitter/Receiver Single Port)', 0.2, '3 MONTHS');
INSERT INTO `jos_vm_product` (`product_id`, `product_parent_id`, `product_sku`, `orig_price`, `price`, `product_s_desc`, `product_desc`, `product_thumb_image`, `product_full_image`, `product_publish`, `product_url`, `product_name`, `discount`, `product_warranty`) VALUES
(735, 0, 'HSP0104E', 24730, 18547, 'This HDMI Splitter is an HDMI splitter with four RJ45 outputs. It distributes the input of the HDMI signal into the four identical outputs simultaneously. Four HDMI Extender Receivers by Cat5 x1 receive the distributed signal from the splitter and transmi', '<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: windowtext; font-family: "><span style="font-size: medium;"> </span></span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="font-family: "><span style="color: #000000; font-size: medium;">HDMI Splitter Amplifier (1 Sender/4 Receiver)</span></span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h3 style="margin: 1em 0in;"><span style="color: windowtext; font-family: ">P/N:  HSP0104E</span></h3>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Description</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="text-align: justify;"><span style="font-family: "><span style="color: #000000;">This HDMI Splitter is an HDMI splitter with four RJ45 outputs. It distributes the input of the HDMI signal into the four identical outputs simultaneously. Four HDMI Extender Receivers by Cat5 x1 receive the distributed signal from the splitter and transmit to displays individually. <br /></span><span style="color: #000000;"> Each receiver works with the splitter as a full functional module. Only by the most inexpensive CAT-5e/6 cable the full functional module extend the HDTV display up to 50 meters for 1080p. <br /></span><span style="color: #000000;"> This HDMI Splitter offers solutions for HDTV retail and show site, HDTV, STB, DVD and Projector factory, noise, space and security concerns, data center control, information distribution, conference room presentation, school and corporate training environments. </span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: ">Specifications</span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="font-family: "><span style="color: #000000;">This HDMI Splitter has many features that enable it to perform in a superior manner. Among those features you will find:<br /></span><span style="color: #000000;"> 1</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Easy to Use: Install in seconds, no need of setting.<br /></span><span style="color: #000000;"> 2</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">One pair as a full functional module, <br /></span><span style="color: #000000;"> 3</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">One piece of CAT-5e/6 cable can substitute HDMI cable to achieve long distance transmission. <br /></span><span style="color: #000000;"> 4</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Follow the standard of IEEE-568B. <br /></span><span style="color: #000000;"> 5</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Transmission distance can be up to 50 meters for 1080p using CAT-6 Cable.<br /></span><span style="color: #000000;"> 6</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Support uncompressed audio such as LPCM7</span></span><span style="font-family: "><span style="color: #000000;">、</span></span><span style="font-family: "><span style="color: #000000;">Support highest video resolution 1080p.<br /></span><span style="color: #000000;"> 8</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Support 165MHz/1.65Gbps per channel (4.95Gbps all channel) bandwidth.<br /></span><span style="color: #000000;"> 9</span></span><span style="font-family: "><span style="color: #000000;">. </span></span><span style="font-family: "><span style="color: #000000;">Support 8bit per channel (24bit all channel) deep color.</span></span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="328" src="data:image/png;base64," border="0" height="322" hspace="12" align="left" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="361" src="data:image/png;base64," border="0" height="146" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"><img width="371" src="data:image/png;base64," border="0" height="137" /></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<h4 style="margin: 1.33em 0in;"><span style="color: windowtext; font-family: "><span style="font-size: small;"> </span></span></h4>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p style="margin: 0in 0in 0pt;"><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>\r\n<p><span style="color: #000000; font-family: Times New Roman; font-size: small;"> </span></p>', 'resized/HSP0104E_HDMI_Sp_53c4aea7e0d06_90x90.jpg', 'HSP0104E_HDMI_Sp_53c4aea815224.jpg', 'y', '', 'HSP0104E HDMI Splitter Amplifier (1 Sender/4 Receiver)', 0.2, '3 MONTHS'),
(763, 0, 'TC800', 7956, 5967, 'UTP AWG#24 Cat 5e Outdoor Cable 1,000ft/ Roll\n\n"Data Cable Brand"\n**Outdoor\n**Pure Copper, Solid Wire', '', 'resized/UTP_AWG_24_Cat_5_546067ca42508_90x90.jpg', 'UTP_AWG_24_Cat_5_546067ca56db0.jpg', 'y', '', 'UTP AWG#24 Cat 5e Outdoor Cable 1,000ft/ Roll', 0.2, 'NO WARRANTY'),
(736, 0, 'UST-RJ45-06', 2580, 1935, 'Console cable USB - RJ45 Male Chipset - FT232RL Length - 1.8M/6ft chips are in the USB connector 3.3V and 5V \r\nA single 1.8M (6 ft) RJ45 Serial RS-232 Mgnt Console port cable that directly connects to your USB port and it just works! Check the pin out spe', '<p>Specifications:</p>\r\n<p>Console cable USB - RJ45 Male Chipset - FT232RL Length - 1.8M/6ft chips are in the USB connector 3.3V and 5V  A single 1.8M (6 ft) RJ45 Serial RS-232 Mgnt Console port cable that directly connects to your USB port and it just works! Check the pin out specification for your particular application before buying.</p>\r\n<p>Functionally equivalent to the Cisco 72-3383-01 plus a USB to DB-9 Serial cable.</p>\r\n<p> </p>\r\n<p>Features:</p>\r\n<p>•	Full support for Windows, MAC and Linux, see the detailed list below.</p>\r\n<p>•	Microsoft (HCL) certified to be compatible with Windows, no CD needed because the drivers are part of the OS distribution.</p>\r\n<p>•	Supports hardware flow control used to implement the CISCO break sequence.</p>\r\n<p>•	FTDI FT232R chip + RS232 Level Shifter.</p>\r\n<p>•	RJ-45 DTE Pin outs RTS (1), DTR (2), TXD (3), GND (4), GND (5), RXD (6), DSR (7), CTS (8).</p>\r\n<p>•	UART interface support for 7 or 8 data bits, 1 or 2 stop bits and odd / even / mark / space / no parity.</p>\r\n<p>•	Cable length is 1.80m (6 feet).</p>\r\n<p>•	USB 2.0 Full Speed compatible.  Benefits:</p>\r\n<p>•	No more cables & adapters to buy and/or make to gets it working.</p>\r\n<p>•	No more DB-9 Adapters.</p>\r\n<p>•	No more Mickey Mouse Prolific driver problems.</p>\r\n<p>•	No more fake prolific chip.</p>\r\n<p> </p>\r\n<p>Supported Operating System:</p>\r\n<p>Drivers are available which allow USB FTDI devices to work with the following operating systems:</p>\r\n<p>•	Windows 8 x32</p>\r\n<p>•	Windows 8 x64</p>\r\n<p>•	Windows Server 2008 R2 x64</p>\r\n<p>•	Windows 7 x32</p>\r\n<p>•	Windows 7 x64</p>\r\n<p>•	Windows Server 2008</p>\r\n<p>•	Windows Server 2008 x64</p>\r\n<p>•	Windows Vista x32</p>\r\n<p>•	Windows Vista x64</p>\r\n<p>•	Windows Server 2003 x32</p>\r\n<p>•	Windows Server 2003 x64</p>\r\n<p>•	Windows XP x32</p>\r\n<p>•	Windows XP x64</p>\r\n<p>•	Windows ME</p>\r\n<p>•	Windows 98</p>\r\n<p>•	Linux</p>\r\n<p>•	Mac OS X</p>\r\n<p>•	Mac OS 9</p>\r\n<p>•	Mac OS 8</p>\r\n<p>•	Windows CE.NET (Version 4.2 and greater)</p>\r\n<p>•	Android</p>\r\n<p> </p>', 'resized/Console_USB_A_to_545d958e47ec9_90x90.jpg', 'Console_USB_A_to_545d958e9e4bf.jpg', 'y', '', 'Console USB A to RJ-45 6ft.', 0.2, '3 MONTHS'),
