(741, 0, 'UST-MDTV03', 1097, 823, 'Specifications:\r\n•	Mini Display Port 1.1a compliant receiver offering 5.4GBPS bandwidth over 2 lanes\r\n•	Integrated triple 10-bit, 162MHz video DAC for analog VGA signal output\r\n•	Supports up to 1080p, 1920 x 1200 reduced blanking video resolution\r\n•	EDID', '<p>Specifications: •	Mini Display Port 1.1a compliant receiver offering 5.4GBPS bandwidth over 2 lanes •	Integrated triple 10-bit, 162MHz video DAC for analog VGA signal output •	Supports up to 1080p, 1920 x 1200 reduced blanking video resolution •	EDID pass-through from PC source display •	Spread Spectrum (de-spreading) for EMI redirection Automatic sink detection •	Low power standby mode operation initiated based on sink detection status •	Powered from Mini Display Port source 3.3V IO, 1.2V Core •	Low power protection – Active 400mW, standby mode 15mW</p>', 'resized/Mini_Display_Por_55e559c1b987c_90x90.jpg', 'Mini_Display_Por_55e559c1c39fc.jpg', 'y', '', 'Mini Display Port (M) to VGA (F) Adapter', 0.2, '3 MONTHS'),
