(744, 0, 'UST-MNHTV10', 1398, 1048, 'Specifications:\r\nThis product has many features that enable it to perform in a superior manner. Among those features you will find:\r\n1.	Easy to Use: Install in seconds, no need of setting.\r\n2.	Conversion: It can convert complete HDMI into VGA video.\r\n3.	S', '<p>Specifications:</p>\r\n<p>This product has many features that enable it to perform in a superior manner.</p>\r\n<p>Among those features you will find:</p>\r\n<p>1.	Easy to Use: Install in seconds, no need of setting.</p>\r\n<p>2.	Conversion: It can convert complete HDMI into VGA video.</p>\r\n<p>3.	Supports HDCP 1.2.</p>\r\n<p>4.	Supports 165MHz/1.65Gbps per channel (6.75Gbps all channel) bandwidth for HDMI Input.</p>\r\n<p>5.	Supports Analogue Video output up to UXGA and 1080p with 10-bit DAC.</p>\r\n<p> </p>\r\n<p> </p>', 'resized/Mini_HDMI__M__to_561dce1e8061c_90x90.jpg', 'Mini_HDMI__M__to_561dce1e8456b.jpg', 'y', '', 'Mini HDMI (M) to VGA (F) with audio Adapter', 0.2, '3 MONTHS'),
