(834, 0, 'WP-504', 2000, 1500, 'WP-504 Laser Pointer Presenter\n  1)Perfect combination by air mouse and wireless presenter \n  2)Annotation with highlighter , no need driver \n  3)Virtual Keyboard to input letter directly. \n  4)Easily control multimedia with functions (volume, play and pause)  \n  5)Shortcut keys to switch window and desktop \n  6)Presentation functions include page down/up, play and black screen.  \n  7)AAAx2 Battery supply, convenient to replace  \n  8)2.4 GHz RF Technology Connection Product Name: Laser Pointer Presenter Model: WP-504 Size: 137x38.5x29mm Net Weight: 68G Distance: 15-20 M Laser Range:\n ', 'WP-504 Laser Pointer Presenter\r\n\r\n•	Perfect combination by air mouse and wireless presenter\r\n•	Annotation with highlighter , no need driver\r\n•	Virtual Keyboard to input letter directly.\r\n•	Easily control multimedia with functions (volume, play and pause)\r\n•	Shortcut keys to switch window and desktop\r\n•	Presentation functions include page down/up, play and black screen.\r\n•	AAAx2 Battery supply, convenient to replace\r\n•	2.4 GHz RF Technology Connection\r\n\r\nProduct Name: Laser Pointer Presenter\r\nModel: WP-504\r\nSize: 137x38.5x29mm\r\nNet Weight: 68G\r\nDistance: 15-20 M\r\nLaser Range:', 'resized/WP_504_Laser_Poi_56a9d894f2d67_90x90.jpg', 'WP_504_Laser_Poi_56a9d895145ed.jpg', 'y', '', 'WP-504 Laser Pointer Presenter', 0.2, '1 MONTH'),
